import React from "react";
import Header from "./components/Header/HeaderPrin";
import {  Router,Switch } from "react-router-dom";
import Pages from "./components/Pages.js";

function App() {
  document.title = "P-WorkFlow";
  return (
    <div className="App">
      <Router>

        <Header />
        <Switch>
        <Pages />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
